import React from 'react'
import { CSSTransition } from 'react-transition-group'

export const Fade = ({ children, ...props }) => (
  <CSSTransition
    {...props}
    timeout={1000}
    classNames="fade"
  >
    {children}
  </CSSTransition>
)
